import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import { ChakraProvider } from '@chakra-ui/react'
import { BrowserRouter } from 'react-router-dom'


ReactDOM.render(

  <ChakraProvider>
      <BrowserRouter>
      <ChakraProvider>
    <App />
    </ChakraProvider>
    </BrowserRouter>
    </ChakraProvider> 
  ,

  document.getElementById('root')
);
